import React from 'react';
import './Header.css';
import logo from './holberton_icon.png'

function Header() {
  return (
    <React.StrictMode>
      <img src={logo} alt="Holberton School"/>
      <div class="pricefooter">
        <div class="button">
          <a href="#2">Boek nu </a> 
          <a href="#1">Info</a>
        </div>
      </div>
    </React.StrictMode>
  );
}

export { Header }
